import React from 'react';


const NotFound = () => {
    return (
        <div style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            backgroundColor: '#f0f4f8',
            textAlign: 'center',
        }}>
            <div style={{
                padding: '40px',
                borderRadius: '8px',
                boxShadow: '0 0 15px rgba(0, 0, 0, 0.1)',
                background: '#ffffff',
                maxWidth: '400px',
            }}>
                <h2 style={{ color: '#333' }}>404 - עמוד לא נמצא</h2>
                <p style={{ color: '#333' }}>העמוד שהנך מחפש לא קיים.</p>
                <p style={{ color: '#333' }}>ייתכן שהקישור שגוי או שהעמוד הוסר.</p>
                <a href="/" className="login-button" style={{
                    display: 'inline-block',
                    padding: '12px 20px',
                    marginTop: '20px',
                    backgroundColor: '#007bff',
                    color: '#fff',
                    border: 'none',
                    borderRadius: '5px',
                    cursor: 'pointer',
                    textDecoration: 'none',
                }}>חזור לדף הבית</a>
                <div style={{ marginTop: '20px' }}>
                    <p>או, תוכל לבדוק את הקישורים הבאים:</p>
                    <a href="/about" style={{ color: '#007bff', textDecoration: 'none' }}>אודות</a> |
                    <a href="/contact" style={{ color: '#007bff', textDecoration: 'none' }}>צור קשר</a>
                </div>
            </div>
        </div>
    );
};

export default NotFound;
